import React from "react";
import { BrowserRouter as Router, Switch } from "react-router-dom";
import Routes from "../../config/Routes";

function MainApp() {
  return (
    <div>
      <p>Header</p>
      <Router>
        <Switch>
          <Routes path="/create-blog"></Routes>
        </Switch>
      </Router>
      <p>Footer</p>
    </div>
  );
}

export default MainApp;
